import React from "react";

const Rank = () => {
  const { name, entries } = this.props;
  return (
    <div>
      <div className='white f3'>
        {`${name}, Your current entry count is....`}
      </div>
      <div className='white f1'>
        {entries}
        </div>
    </div>
  );
};

export default Rank;
